import React, { useState } from 'react';
import './Contact.css';

const Contact = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    subject: '',
    message: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Create WhatsApp message
    const whatsappMessage = `Hello! I'm interested in booking:\n\nName: ${formData.name}\nEmail: ${formData.email}\nSubject: ${formData.subject}\nMessage: ${formData.message}`;
    const whatsappUrl = `https://wa.me/971501234567?text=${encodeURIComponent(whatsappMessage)}`;
    window.open(whatsappUrl, '_blank');
    setFormData({ name: '', email: '', subject: '', message: '' });
  };

  const handleWhatsApp = () => {
    const message = 'Hello! I would like to know more about your buggy rental services.';
    window.open(`https://wa.me/971501234567?text=${encodeURIComponent(message)}`, '_blank');
  };

  const handleCall = () => {
    window.location.href = 'tel:+971501234567';
  };

  const handleInstagram = () => {
    window.open('https://instagram.com/dejavuadventure', '_blank');
  };

  return (
    <div className="contact-page">
      <div className="hero-section">
        <div className="hero-overlay">
          <div className="container">
            <div className="hero-content">
              <h1>Contact Us</h1>
              <p>Home ‚Üí Contact Us</p>
            </div>
          </div>
        </div>
      </div>

      <div className="contact-content">
        <div className="container">
          <div className="contact-main">
            <div className="contact-info">
              <div className="info-section">
                <h3>Get In Touch</h3>
                <h2>Our Contact Information</h2>
              </div>

              <div className="contact-details">
                <div className="contact-item">
                  <div className="contact-icon">üìç</div>
                  <div className="contact-text">
                    <h4>Our Address</h4>
                    <p>Sharjah, United Arab Emirates</p>
                  </div>
                </div>

                <div className="contact-item">
                  <div className="contact-icon">üìû</div>
                  <div className="contact-text">
                    <h4>Phone Number</h4>
                    <p>+971 50 123 4567</p>
                    <p>+971 6 123 4567</p>
                  </div>
                </div>

                <div className="contact-buttons">
                  <button onClick={handleWhatsApp} className="btn-contact whatsapp">
                    üì± WhatsApp
                  </button>
                  <button onClick={handleCall} className="btn-contact call">
                    üìû Call Now
                  </button>
                  <button onClick={handleInstagram} className="btn-contact instagram">
                    üì∑ Instagram
                  </button>
                </div>

                <div className="contact-item">
                  <div className="contact-icon">‚úâÔ∏è</div>
                  <div className="contact-text">
                    <h4>Email Address</h4>
                    <p>malinfo00@tourm.com</p>
                    <p>supuurt24@tourm.com</p>
                  </div>
                </div>
              </div>
            </div>

            <div className="contact-form-section">
              <h3>Send Us A Message</h3>
              <form onSubmit={handleSubmit} className="contact-form">
                <div className="form-group">
                  <input
                    type="text"
                    name="name"
                    placeholder="Your Name"
                    value={formData.name}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group">
                  <input
                    type="email"
                    name="email"
                    placeholder="Your Email"
                    value={formData.email}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group">
                  <input
                    type="text"
                    name="subject"
                    placeholder="Subject"
                    value={formData.subject}
                    onChange={handleChange}
                    required
                  />
                </div>
                <div className="form-group">
                  <textarea
                    name="message"
                    placeholder="Your Message"
                    rows="6"
                    value={formData.message}
                    onChange={handleChange}
                    required
                  />
                </div>
                <button type="submit" className="btn btn-primary btn-large">
                  Send via WhatsApp
                </button>
              </form>
            </div>
          </div>

          <div className="map-section">
            <h3>Find Us on Map</h3>
            <div className="map-container">
              <iframe
                src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3609.1234567890123!2d55.39000000000001!3d25.35000000000001!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3e5f5b1234567890%3A0x1234567890abcdef!2sSharjah%2C%20United%20Arab%20Emirates!5e0!3m2!1sen!2sus!4v1234567890123!5m2!1sen!2sus"
                width="100%"
                height="450"
                style={{ border: 0, borderRadius: '12px' }}
                allowFullScreen=""
                loading="lazy"
                referrerPolicy="no-referrer-when-downgrade"
                title="Location Map"
              ></iframe>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Contact;
